    tag: string;
}

const StyledWRIndexTag: FC<StyledWRIndexTagProps> = ({tag}) => {
    const {colors, sizes} = useTheme();
    console.log(sizes)
    return (
        <Center px={'6px'} py={sizes[3]} backgroundColor={'#30373F'} borderRadius={sizes[6]}>
            <Text fontWeight={600} fontSize={'13px'} color={'#8097BE'} lineHeight={18}>
                {tag}
            </Text>
        </Center>
    )
}

export {StyledWRIndexTag};
